export function showCartItems(FinalCartItems) {
    return (FinalCartItems.map(
        (element) => {
            let key = Object.keys(element)
            return(
            <tr key={key}>
                <td className="">{key}</td>
                <td>{element[key]}</td>
            </tr>)
        }
    ))
}
